import React from 'react';
import './App.css';
import BlogPost from './components/BlogPost';

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>attyx Blog</h1>
      </header>
      <main className="app-main">
        <BlogPost />
      </main>
    </div>
  );
}

export default App;
